import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import AboutPhoto from './images/About.jpg';
import img1 from './images/projects/img1.jpg';
import img2 from './images/projects/img2.jpg';
import img3 from './images/projects/img3.jpg';
import { Button } from './Button';
import "./ProjectSection.css";
import AOS from 'aos';
import 'aos/dist/aos.css';

function ProjectSection () {

    function openItch() {
        const emailAddress = 'georgewalkerphillips5@gmail.com';
        const subject = 'Contact Request from My Website';
        const body = 'Dear [Your Name],\n\nI am interested in learning more about your work and would like to connect with you regarding potential collaboration opportunities.\n\nBest regards,\n[Your Name]';
        const mailtoLink = `mailto:${emailAddress}?subject=${encodeURIComponent(subject)}&body=${encodeURIComponent(body)}`;
        window.location.href = mailtoLink;
      }

    {/* Scroll Animation */ }
    useEffect(() => {
        AOS.init({ duration: 200 });
    })
    
    return (
        <section className="project-section" id="project">
            <div className="project-heading" data-aos="zoom-in">
                <h2>03. Projects</h2>
            </div>

            <div className='card-section'>

                <div class="project-row" data-aos="zoom-in">
                    <div class="project-column">
                        <div class="project-card">
                            <img src={img1} alt="Jane"/>
                            <div class="project-container">
                                    <h2>Project 1</h2>
                                    <p class="project-title">Details</p>
                                    <p>Some text that describes me lorem ipsum ipsum lorem.</p>
                                    <br></br>
                                <p><Button class="project-button"
                                     onClick={openItch}
                                    >More Info</Button></p>
                                <br></br>
                                </div>
                        </div>
                    </div>

                    <div class="project-column">
                        <div class="project-card">
                            <img src={img2} alt="Jane" />
                            <div class="project-container">
                                <h2>Project 2</h2>
                                <p class="project-title">Details</p>
                                <p>Some text that describes me lorem ipsum ipsum lorem.</p>
                                <br></br>
                                <p><Button class="project-button">More Info</Button></p>
                                <br></br>
                            </div>
                        </div>
                    </div>

                    <div class="project-column">
                        <div class="project-card">
                            <img src={img3} alt="Jane"/>
                            <div class="project-container">
                                    <h2>Rogue Like Game Jam</h2>
                                    <p class="project-title">A Dark But Not So Scary Dungeon</p>
                                    <p>I created this game for 0h Game Jam on itch.io</p>
                                    <br></br>
                                    <p><Button class="project-button">More Info</Button></p>
                                    <br></br>
                                </div>
                        </div>
                    </div>
                    
                </div>
                
            </div>
            
            
        </section>
    )
}

export default ProjectSection
